function split_to_chunks(str, chunk_size) {
    const chunk_inds = Array.from(Array(str.length / chunk_size).keys());
    return chunk_inds.map(function(i) {return str.substr(i * chunk_size, chunk_size)});
}

function calculate_meduyeket(date) {
    const [day, month, year] = date.split('.').map(function(x) {return parseInt(x);});
    const start_ts = new Date(2022, 1, 1).getTime();
    const date_ts = new Date(year, month, day).getTime();
    const day_number = Math.round((date_ts - start_ts) / 86400000);
    const ind = (day_number * 5) % POSSIBLE_MEDUYAKOT.length;
    return POSSIBLE_MEDUYAKOT.substr(ind, 5);
}

